te, \"idleup\"),\n                MessageBox {message = \"B: It seems as though we are all in agreement.\"},\n                MessageBox {message = \"B: I have only one condition...\"},\n                MessageBox {message = \"B: Take me with you first. {p60}I need to see how safe your home base is for myself.\"},\n                MessageBox {message = \"Sally: That's great B!\"},\n                MessageBox {message = \"Sally: We have an important mission to finish first.{p60} After that, we can bring you to Knothole.\"},\n                walkin,\n                Do(function()\n                    self:refreshKeyHint()\n                    self.scene.player.x = self.scene.player.x + 60\n                    self.scene.player.y = self.scene.player.y + 60\n                end)\n            }\n        else\n            return BlockPlayer {\n                Do(function() self:facePlayer() end),\n                MessageBox {message = \"B: Have you spoken to everyone yet?\"},\n                Do(function() self:refreshKeyHint() end)\n            }\n        end\n    else\n        GameState:setFlag(\"ep3_spoke_b1\")\n        local walkout, walkin, sprites = self.scene.player:split()\n        return BlockPlayer {\n            Do(function() self:facePlayer() end),\n            walkout,\n            Animate(sprites.sonic.sprite, \"idleup\"),\n            Animate(sprites.sally.sprite, \"idleup\"),\n            Animate(sprites.antoine.sprite, \"idleup\"),\n            MessageBox {message = \"B: Welcome, Ms. Acorn{p60}, Mr. Hedgehog...\"},\n            MessageBox {message = \"B: Ah, and this must be Mr. Depardieu. {p60}On another mission that requires our help?\"},\n            MessageBox {message = \"Sonic: Not exactly... {p60}listen B, {p60}we know you are afraid of movin the Forgotten to Knothole, but--\"},\n            Animate(self.sprite, \"pose\"),\n            MessageBox {message = \"B: I know what you're going to say, and the answer is still 'no'.\"},\n            Animate